components:
- components: []
  layout_properties: {slot: default}
  name: content_panel
  properties: {}
  type: ColumnPanel
- components:
  - event_bindings: {click: my_course_click}
    layout_properties: {}
    name: my_course
    properties: {italic: true, text: My Courses, visible: false}
    type: Link
  - event_bindings: {click: log_out_button_click}
    layout_properties: {}
    name: log_out_button
    properties: {font_size: 19, foreground: 'theme:White', icon: 'fa:sign-out', italic: true, text: Sign Out, visible: false}
    type: Button
  - components: []
    data_bindings: []
    event_bindings: {click: sign_in_click}
    layout_properties: {width: null}
    name: sign_in
    properties: {icon: 'fa:sign-in', italic: true, text: Sign In}
    type: Link
  layout_properties: {slot: nav-right}
  name: navbar_links
  properties: {}
  type: FlowPanel
- data_bindings: []
  event_bindings: {click: title_click}
  layout_properties: {slot: top-left-btn}
  name: title
  properties: {icon: _/theme/Columbia%20State%20Logo%20cropped.png, text: 'AWD Web Store '}
  type: Link
container:
  properties: {html: '@theme:standard-page.html'}
  type: HtmlTemplate
is_package: true
